import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { loadPrice } from "../redux/actions";



function Home() {

  let dispatch = useDispatch();
  const { prices } = useSelector((state) => state.prices);

  useEffect(() => {
    dispatch(loadPrice());
  }, []);

  console.log("value of API",prices)

  return (
    <div >
        <div className="flex flex-row  justify-between ">
      <div class="flex mt-4 ">
        <div class="flex-none  text-center outline  outline-1 rounded-full px-2  ">
          on Sale
        </div>
        <div class="flex-none outline-offset-2 outline-1 rounded-full px-6 mx-4 bg-gray-200">
          All
        </div>
     
      </div>

      <div class="flex py-4 ">
        <div className=" px-2 border rounded-lg">
            Higher Prices â–¼
        </div>
        
        </div>
        </div>
       <div className="py-4 flex-row">
          {prices?.length > 0 &&
            prices.map((dollarprice) => (
              <><div class="box-border h-32 w-32 p-4 border-4 ">

              </div><h1>{dollarprice.price}</h1></>

  
            ))}  
            </div>
                
  
    </div>
  );
}

export default Home;
